import React from 'react'
import Navbar from '../components/navbar'
import Func from '../components/Func';



class PremierAcCours extends React.Component {


  render(){
  return (
    <div>
        <Navbar />
        <h1 style={{paddingTop : '200px'}}>je suis la page premier ac</h1>
        <Func pth = "/PremierAcCours" pr={this.state.item2}/>
    </div>
  )
  }
}

export default PremierAcCours;
